import './App.css';
import Navbar from './components/Navbar'
import Footer from './Footer'
import {BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './pages/Home';

function App() {
  return ( 
  <div className="App">
     <Router>    
        <Navbar/>
        <Switch>
           <Route path= '/' exact component= {Home}/>
         </Switch>
         <Footer/>
     </Router>
    </div>

  );
}

export default App;
